import React, { useState } from "react";
import { Text, View, StyleSheet, Image, ScrollView, ImageBackground, FlatList, TouchableOpacity } from "react-native"
import colors from "../../constant/colors";
import {
    useFonts,
    Poppins_100Thin,
    Poppins_100Thin_Italic,
    Poppins_200ExtraLight,
    Poppins_200ExtraLight_Italic,
    Poppins_300Light,
    Poppins_300Light_Italic,
    Poppins_400Regular,
    Poppins_400Regular_Italic,
    Poppins_500Medium,
    Poppins_500Medium_Italic,
    Poppins_600SemiBold,
    Poppins_600SemiBold_Italic,
    Poppins_700Bold,
    Poppins_700Bold_Italic,
    Poppins_800ExtraBold,
    Poppins_800ExtraBold_Italic,
    Poppins_900Black,
    Poppins_900Black_Italic,
} from '@expo-google-fonts/poppins';
import { Entypo, Ionicons, Octicons, FontAwesome, AntDesign } from '@expo/vector-icons';
import AppLoading from "expo-app-loading";
import Header from "../../components/header/Header";
import YellowBtn from "../../components/button/YellowBtn";
import { url } from "../../constant/url";
import { useNavigation } from "@react-navigation/native";
import LoginButton from "../../components/button/LoginButton";


const ViewTaskDetail = () => {
    let [fontsLoaded] = useFonts({
        Poppins_100Thin,
        Poppins_100Thin_Italic,
        Poppins_200ExtraLight,
        Poppins_200ExtraLight_Italic,
        Poppins_300Light,
        Poppins_300Light_Italic,
        Poppins_400Regular,
        Poppins_400Regular_Italic,
        Poppins_500Medium,
        Poppins_500Medium_Italic,
        Poppins_600SemiBold,
        Poppins_600SemiBold_Italic,
        Poppins_700Bold,
        Poppins_700Bold_Italic,
        Poppins_800ExtraBold,
        Poppins_800ExtraBold_Italic,
        Poppins_900Black,
        Poppins_900Black_Italic,
    });
    const [value, setValue] = useState('')
    const [fav, setFav] = useState(false)
    const bgImage = 'https://images.unsplash.com/photo-1557683316-973673baf926?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxleHBsb3JlLWZlZWR8OHx8fGVufDB8fHx8&w=1000&q=80'
    const discription = 'Get added to Team/Workspace from here. Details of the group will appear here (About Page). Get added to Workspace from here. Details of the group will appear here (About Page). Get added to Workspace from here. Details of the group will appear here (About Page).'

    const favStatus = () => {
        setFav(!fav)
    }


    const images = [
        'https://www.w3schools.com/w3images/avatar6.png',
        'https://www.w3schools.com/w3images/avatar6.png',
        'https://www.w3schools.com/w3images/avatar6.png',
        'https://www.w3schools.com/w3images/avatar6.png',
    ]

    const navigation = useNavigation()

    return !fontsLoaded ? <AppLoading /> : (
        <ImageBackground source={{ uri: bgImage }} style={{ flex: 1, width: '100%', height: '100%' }}>

            {/* <Header endHeading={'You'} headingStyle={{ fontSize: 20, color: 'black', fontFamily: 'Poppins_700Bold' }} />  */}
            {/* <Text style={styles.activity} >Activity</Text>  */}
            <View style={{ height: '30%', justifyContent: 'space-between' }}>
                <TouchableOpacity onPress={() => navigation.goBack()}>
                    <Ionicons name="chevron-back" size={50} color="white" style={{ marginTop: 40 }} />
                </TouchableOpacity>

                <View style={styles.leavebtnView}>
                    <Text style={styles.duedate}>{'Task Detail'}</Text>
                </View>

                <Text>{''}</Text>


            </View>
            <ScrollView style={{ backgroundColor: 'white', height: '70%', paddingHorizontal: 30, borderTopLeftRadius: 30, borderTopRightRadius: 30 }}>
                {/* <View style={{ marginTop: 30, flexDirection: 'row', alignItems: 'center' }}>
                    <Image source={{ uri: url }} style={{ height: 40, width: 40, borderRadius: 50 }} />
                    <Text style={{ fontFamily: 'Poppins_600SemiBold', fontSize: 14, paddingHorizontal: 10 }}>Sia - Group Admin</Text>
                </View> */}

                <Text style={{ fontSize: 20, fontFamily: 'Poppins_400Regular', color: 'black', marginTop: 30 }}>{'Front End Developer'}</Text>
                <Text style={{ fontSize: 14, fontFamily: 'Poppins_400Regular', color: colors.grey, marginTop: 15 }}>{discription}</Text>
                <Text style={{ fontSize: 16, fontFamily: 'Poppins_400Regular', color: 'black', marginVertical: 15 }}>{'Tags Person'}</Text>

                <FlatList
                    horizontal={true}
                    showsVerticalScrollIndicator={false}
                    data={images}
                    keyExtractor={items => items.id}
                    renderItem={({ item }) => (
                        <TouchableOpacity>
                            <Image style={{ height: 45, width: 45, borderRadius: 100, marginRight: 15 }} source={{ uri: item }} />
                        </TouchableOpacity>
                    )}
                />

                <Text style={{ fontSize: 16, fontFamily: 'Poppins_400Regular', color: 'black', marginTop : 20 }}>{'Timeline'}</Text>
                <Text style={{ fontSize: 14, fontFamily: 'Poppins_400Regular', color: colors.grey , marginTop : 15 }}>{'12/Aug/2022 - 18/Aug/2022'}</Text>

                <LoginButton onPress={() => alert('Complete Task')} title={'Complete Task'} textStyle={styles.LoginButtonText} style={styles.LoginButton} />



            </ScrollView>
        </ImageBackground>

    )
}

export default ViewTaskDetail;

const styles = StyleSheet.create({
    Mainview: { flex: 1, backgroundColor: '#fff' },
    LeaveBtn: { justifyContent: 'center', alignItems: 'center' },
    activity: { fontSize: 40, color: 'black', fontFamily: 'Poppins_700Bold', marginHorizontal: 15, marginTop: 45 },
    MainCard: { marginHorizontal: 10, flexDirection: 'row', alignItems: 'center', marginTop: 29 },
    userImage: { height: 50, width: 50, borderRadius: 50 },
    postedBy: { fontSize: 13, fontFamily: 'Poppins_700Bold' },
    postedByTime: { fontSize: 13, fontFamily: 'Poppins_400Regular', color: colors.grey },
    leavebtnView: { flexDirection: 'row', justifyContent: 'space-between', margin: 10 },
    teamname: { fontSize: 14, fontFamily: 'Poppins_700Bold', paddingHorizontal: 10, borderRadius: 10, color: 'white' },
    duedate: { fontSize: 30, fontFamily: 'Poppins_700Bold', borderRadius: 10, color: 'white' },
    LoginButton: { marginBottom: 20, backgroundColor: colors.blue , marginTop : 30, padding: 10, borderRadius: 100 },
    LoginButtonText: { color: 'white', fontFamily: 'Poppins_700Bold' },


})
